import { getManager } from "typeorm";
import { Platform } from "../common/Platform";

export class ContextModel {
  public project: string;
  public projects: {[project: string]: {[attr: string]: any}};
  
  constructor(projects: {[project: string]: {}}) {
    this.project = "";
    this.projects = {
      helm: { root: "/Users/ncbrad/do/helm" }
    };
  }
  
  public async search(opts: {searchTerm: string, project: string}) {
    if (opts.project && !Object.keys(this.projects).includes(opts.project)) {
      throw new Error(`Project ${opts.project} is not defined in the config file.`);
    }

    this.project = opts.project;
    const term = opts.searchTerm;
    const entityManager = getManager();
    const openWindowTitles = Platform.listWindows().map(w => w.title.substring(0, 50).toLowerCase());

    // const windowResults = (await createQueryBuilder(Window)
    //   .innerJoin(ProjectSession, "ses", "window.created between ses.start and ses.end and ses.project = :project", {project: activeProject})
    //   .leftJoin(Application, "app", "app.name = lower(window.app)")
    //   .where("title like :search", {search: `%${term}%`})
    //   .andWhere("substr(title,0, 100) IN (:...titles)", { titles: openWindowTitles })
    //   .groupBy("title")
    //   //.having("created = max(created)")
    //   .select(["icon", "name", "title"])
    //   .limit(10)
    //   .getRawMany())
    //   .map(r => ({
    //     icon: r.icon,
    //     title: r.title,
    //     description: r.name,
    //     group: "window"
    //   }));

    // The IN operator uses a workaround since node-sqlite3 doesn't support passing IN a parameter
    // https://github.com/mapbox/node-sqlite3/issues/527#issuecomment-400021528.

    // TODO: On Linux the app name from Platform.listWindows doesn't always match the name recorded in the Window table; check this on mac!
    const windowRawResults = await entityManager.query(`
        with grouped as (
          select icon,
                 name,
                 title,
                 count(*)      as frequency,
                 max(created)  as recency,
                 sum(duration) as duration
          from window win
                 join project_session ses on win.created between ses.start and ses.end and ses.project = ?
                 left join application app on app.name = lower(win.app)
          where title like ? and lower(substr(title, 0, 51)) IN (${openWindowTitles.map(_ => "?")})
          group by title
        ),
             stats as (
               select icon,
                      name,
                      title,
                      percent_rank() over (order by frequency) as frequency_rank,
                      percent_rank() over (order by recency)   as recency_rank,
                      percent_rank() over (order by duration)  as duration_rank
               from grouped
             )
        select icon,
               name,
               title,
               0.8 * recency_rank + 0.15 * frequency_rank + 0.05 * duration_rank as relevance
        from stats
        order by 0.8 * recency_rank + 0.15 * frequency_rank + 0.05 * duration_rank desc
        limit 10;
        `, [this.project, `%${term}%`, ...openWindowTitles]);

    console.log("PROJECT:", this.project);
    console.log("SEARCH TERM:", term);
    console.log("WINDOW TITLES", openWindowTitles);
    console.log("***WINDOW RAW RESULTS****", windowRawResults);

    const windowResults = windowRawResults.map((r : any) => ({
      icon: r.icon,
      title: r.title,
      description: r.name,
      group: "window",
      relevance: r.relevance
    }));

    // const browserResults = (await createQueryBuilder(Browser)
    //   .innerJoin(ProjectSession, "ses", "browser.created between ses.start and ses.end and ses.project = :project", { project: activeProject })
    //   .leftJoin(Tracker, "tracker", "tracker.id = browser.trackerId")
    //   .leftJoin(Application, "app", "app.name = case when tracker.key like '%firefox%' then 'firefox' else 'google chrome' end")
    //   .where("title like :search", { search: `%${term}%` })
    //   .orWhere("url like :search", { search: `%${term}%` })
    //   .groupBy("title")
    //   .having("browser.created = max(browser.created)")
    //   .limit(10)
    //   .select(["icon", "title", "url"])
    //   .getRawMany())
    //   .map(r => ({
    //     icon: r.icon,
    //     title: r.title,
    //     description: r.url,
    //     url: r.url,
    //     group: "website"
    //   }));

    const browserRawResults = await entityManager.query(`
        with grouped as (
          select icon,
                 title,
                 url,
                 count(*)              as frequency,
                 max(browser.created)  as recency,
                 sum(duration)         as duration
          from browser
                 join project_session ses on browser.created between ses.start and ses.end and ses.project = ?
                 left join tracker on tracker.id = browser.trackerId
                 left join application app on app.name = case when tracker.key like '%firefox%' then 'firefox' else 'google chrome' end
          where title like ? or url like ?
          group by title
        ),
             stats as (
               select icon,
                      title,
                      url,
                      percent_rank() over (order by frequency) as frequency_rank,
                      percent_rank() over (order by recency)   as recency_rank,
                      percent_rank() over (order by duration)  as duration_rank
               from grouped
             )
        select icon,
               title,
               url,
               0.8 * recency_rank + 0.15 * frequency_rank + 0.05 * duration_rank as relevance
        from stats
        order by 0.8 * recency_rank + 0.15 * frequency_rank + 0.05 * duration_rank desc
        limit 10;
        `, [this.project, `%${term}%`, `%${term}%`]);

    const browserResults = browserRawResults.map((r: any) => ({
      icon: r.icon,
      title: r.title,
      description: r.url,
      url: r.url,
      relevance: r.relevance,
      group: "website"
    }));

    // const fileResults = (await createQueryBuilder(Editor)
    //   .innerJoin(ProjectSession, "ses", "editor.created between ses.start and ses.end and ses.project = :project", { project: activeProject })
    //   .where("file like :search", { search: `%${term}%` })
    //   .groupBy("file")
    //   .having("editor.created = max(editor.created)")
    //   .select(["file"])
    //   .limit(10)
    //   .getRawMany())
    //   .map(r => ({
    //     icon: "data:image/png;base64,",
    //     title: r.file,
    //     description: "",
    //     path: "/home/ncbradley/do/helm/" + r.file,
    //     group: "file"
    //   }));

    const fileRawResults = await entityManager.query(`
        with grouped as (
          select file,
                 trackerId,
                 count(*)      as frequency,
                 max(created)  as recency,
                 sum(duration) as duration
          from editor
                 join project_session ses on editor.created between ses.start and ses.end and ses.project = ?
          where file like ?
          group by file, trackerId
        ),
             stats as (
               select file,
                      trackerId,
                      percent_rank() over (order by frequency) as frequency_rank,
                      percent_rank() over (order by recency)   as recency_rank,
                      percent_rank() over (order by duration)  as duration_rank
               from grouped
             )
        select file, tracker.client as client,
               0.8 * recency_rank + 0.15 * frequency_rank + 0.05 * duration_rank as relevance
        from stats
        left join tracker on tracker.id = stats.trackerId
        order by 0.8 * recency_rank + 0.15 * frequency_rank + 0.05 * duration_rank desc
        limit 10;
        `, [this.project, `%${term}%`]);

    const fileResults = fileRawResults.map((r: any) => ({
      icon: "data:image/png;base64,",
      title: r.file,
      description: "",
      path: `${this.projects[this.project].root}/${r.file}`,
      relevance: r.relevance,
      group: "file",
      custom: {
        tracker: r.client,
        project: this.projects[this.project].root,
        file: r.file
      }
    }));

    // const shellRawResults = await createQueryBuilder(Shell)
    //   .innerJoin(ProjectSession, "ses", "shell.created between ses.start and ses.end and ses.project = :project", { project: activeProject })
    //   .where("session in (select session from shell where cmdStr like :search)", { search: `%${term}%` })
    //   .limit(10)
    //   .orderBy("session")
    //   .select(["session", "created", "cmdStr", "cwd", "duration", "code"])
    //   .getRawMany();

    const shellRawResults = await entityManager.query(`
        with grouped as (
          select session,
                 cmdstr,
                 count(*)      as frequency,
                 max(created)  as recency,
                 sum(duration) as duration
          from shell
                 join project_session ses on shell.created between ses.start and ses.end and ses.project = ?

          where cmdstr like ?
          group by session, cmdstr
        ),
             stats as (
               select session,
                      cmdstr,
                      percent_rank() over (order by frequency) as frequency_rank,
                      percent_rank() over (order by recency)   as recency_rank,
                      percent_rank() over (order by duration)  as duration_rank
               from grouped
             ),
             ranked as (
               select session,
                      cmdstr,
                      0.8 * recency_rank + 0.15 * frequency_rank + 0.05 * duration_rank as relevance
               from stats
             ),
             sessionstats as (
               select session,
                      max(relevance) as relevance
               from ranked
               group by session
               order by max(relevance)
               limit 10
             )
        select shell.session,
               created,
               shell.cmdstr,
               cwd,
               code,
               duration,
               relevance
        from shell
               join sessionstats
                    on shell.session = sessionstats.session
        order by relevance desc, shell.session, created desc
        `, [this.project, `%${term}%`]);

    const shellResults = [];
    let prevSession = "";
    for (const record of shellRawResults) {
      const command = {
        cwd: record.cwd,
        cmd: record.cmdStr,
        duration: record.duration,
        code: record.code,
        isSelected: false
      };

      if (record.session === prevSession) {
        const sessionRecord = shellResults[shellResults.length - 1];
        sessionRecord.commands.push(command);
        sessionRecord.description = `${sessionRecord.commands.length} commands`;
      } else {
        shellResults.push({
          icon: "data:image/png;base64,",
          title: new Date(`${record.created} UTC`).toLocaleString(),
          description: "1 command",
          commands: [command],
          group: "shell session"
        });

      }

      prevSession = record.session;
    }

    return windowResults.concat(browserResults).concat(fileResults).concat(shellResults);


  }
}




